answer = validaAcesso();

function validaAcesso(){
	var hasAccess = false;

	var access = {
		"user" : current.variables.user.toString(),
		"pwd" : current.variables.pwd.toString()
	};

	var request = {
		"user" : current.variables.user.toString(),
		"url" : current.variables.instancia.toString()
	};

	var util = new HealthScan();
	hasAccess = util.validAccess(access, request);

	if (hasAccess == true) {
		return 'yes';
	}
	return 'no';
}

